const INITIAL_STATE={
    yaziListesi:[]
}
export const yaziListesiGetir=(state:INITIAL_STATE)=>(dispatch)=>{
    switch (action.type) {
        case 'YAZI_LISTESİ_GETIR':
        return {...state,yaziListesi:action.payload}

            break;

        default:
            return state;
    }
}
